import { ThemeOptions } from '@mui/material/styles';

export const themeOptions= {
  palette: {
    mode: 'dark',
    primary: {
      main: '#dddce0',
      dark: '#995bd8',
      light: '#27005c',
    },
    secondary: {
      main: '#448aff',
    },
    background: {
      paper: '#9D85F2',
      default: '#7E5EF2',
    },
  },
  spacing: 8
};
